import React from "react";
import { Link } from "react-router-dom";
import "./Nav.css";

function Nav() {

    return (
        <nav>
        <Link to="/">Home</Link> 
        <Link to="/submitdare">Do a dare</Link>
        <Link to="/dares">Fund a dare</Link>
        </nav>
    );
}

export default Nav;
